export const Icon = (props) => {
  const size = props.size ? props.size : 16;
  const renderIcon = () => {
    const iconData = icons[props.name];

    if (!iconData) return null;

    // Check if the icon is a complex (multi-path) icon
    if (typeof iconData === "object") {
      const elements = [];

      // Render paths if they exist
      if (iconData.paths) {
        elements.push(
          ...iconData.paths.map((pathProps, index) => (
            <path key={`path-${index}`} {...pathProps} />
          )),
        );
      }

      // Render polygons if they exist
      if (iconData.polygons) {
        elements.push(
          ...iconData.polygons.map((polygonProps, index) => (
            <polygon key={`polygon-${index}`} {...polygonProps} />
          )),
        );
      }
      if (iconData.circle) {
        elements.push(
          ...iconData.circle.map((circleProps, index) => (
            <circle key={`circle-${index}`} {...circleProps} />
          )),
        );
      }

      return elements;
    } else {
      // Single path icon (backward compatibility)
      return <path d={iconData} fill={props.fill || "currentColor"}></path>;
    }
  };

  return (
    <svg
      onClick={(e) => {
        if (props.onClick) props.onClick(e);
      }}
      className={cn(props.className)}
      width={size}
      height={size}
      viewBox={props.viewBox ?? `0 0 ${16} ${16}`}
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      {renderIcon()}
    </svg>
  );
};
